import { authRoles } from './auth/authRoles'

export const navigations = [
    {
        name: 'Dashboard',
        path: '/dashboard',
        icon: 'dashboard',
    },
    {
        label: 'Login',
        type: 'label',
    },
    {
        name: 'Autenticação',
        icon: 'security',
        children: [
            {
                name: 'Login',
                iconText: 'SI',
                path: '/session/signin',
            },
            {
                name: 'Cadastre-se',
                iconText: 'SU',
                path: '/session/signup',
            },
            {
                name: 'Forgot Password',
                iconText: 'FP',
                path: '/session/forgot-password',
            },
            {
                name: 'Error',
                iconText: '404',
                path: '/session/404',
            },
        ],
    },

    {
        label: 'Páginas',
        type: 'label',
    },
    {
        name: 'Filtros',
        icon: 'format_list_bulleted',
        badge: { value: '30+', color: 'secondary' },
        children: [
            {
                name: 'Período',
                path: '/material/autocomplete',
                iconText: 'A',
            },
            {
                name: 'Valor Cotado',
                path: '/material/buttons',
                iconText: 'B',
            },
            {
                name: 'Orgão',
                path: '/material/checkbox',
                iconText: 'C',
            },
            {
                name: 'Município',
                path: '/material/dialog',
                iconText: 'D',
            },
            {
                name: 'Licitante Vencedor',
                iconText: 'D',
                path: '/others/drag-and-drop',
            },
            {
                name: 'Valor',
                path: '/material/expansion-panel',
                iconText: 'E',
            },
            {
                name: 'Qtd. Comprada',
                path: '/material/form',
                iconText: 'F',
            },
            {
                name: 'Natureza da Despesa',
                path: '/material/icons',
                iconText: 'I',
            },
            {
                name: 'Forma de Pagamento',
                path: '/material/menu',
                iconText: 'M',
            },
            {
                name: 'Modalidade de Licitação',
                path: '/material/progress',
                iconText: 'P',
            },

        ],
    },

]
